isError :: Token -> Bool
isError (TkError _) = True
isError _ = False

perro :: String -> ([Token], [Token])
perro s = partition (not.isError) (alexScanTokens s)

perror ( TkError (e, (AlexPn _ n m)) ) = "Caracter invlido " ++ e : " en la lnea " ++ (show n) ++ " columna " ++ (show m)
perror _ = ""

getTokens f = do
  s <- readFile(f)
  let p = perro s
  _ <- mapM putStrLn (map perror (snd p))
  return (fst p)
 
